import React from 'react';
import { Cascader } from 'antd';


const options = [
    {
      value: 'zhejiang',
      label: 'Zhejiang',
    }]
const onChange = (value) => {
    console.log(value);
    };
const NavbarReport = () => {
  return (
    <div style={{background:"white", width:"1120px", height:"70px"}}  mode="horizontal" >
     <p style={{padding:"20px"}}>Reports
        <Cascader style={{padding:"10px"}} options={options} onChange={onChange} placeholder="Please select" />
        </p> 
    </div>
  )
}

export default NavbarReport
